ou are sitting in a Las Vegas casino playing poker. You are down to your last few dollars, you go all in and you wind up being dealt a Royal Flush, and suddenly the sky is bluer, the grass is greener, and all your worries seem to just fade away.\r\n\r\nAt first things were a little awkward for the both of us. We decided to hold of on actually meeting until we got to know each other first. We spent a month just talking everyday on the internet. You can really open up to someone and show them the real you and not have to worry about rejection on the internet, after all you are just a faceless ghost, and if things donât work out you could be sitting next to her on the bus one day without ever knowing it.\r\n\r\nThe key to finding happiness is realizing you are going to bust more then you are going to get blackjack, but you must keep trying, trying to remember you only need to find the real thing once.', 'Branding Do You Know Who You Are', '', 'publish', 'open', 'open', '', 'branding-do-you-know-who-you-are-19', '', '', '2017-02-14 17:59:45', '2017-02-14 17:59:45', '', 0, 'http://virgo.paul-themes.com/?p=1041', 0, 'post', '', 0);
